% Do preparations 
if doSigm
    rsigma = 1./sigma;
    A = bsxfun(@times, A, rsigma);
end;

% find the bin index of each value:
[dummy,bin] = histc(A(:),limits);%#ok : dummy cannot be avoided
invalid = bin==0;
bin(invalid)=1;
% For tail part, take reciprocal:
A(bin>cutoffbinidx)=1./A(bin>cutoffbinidx);
% reduce with base of interpolating polynomials:
x = A(:)-origins(bin);
x(invalid)=nan;

stbl = size(funcs{1},2);
funcs = funcs(fsel);
sigmpwr = sigmpwr(fsel);
ndo = min(nargout, numel(funcs));

for fidx = 1:ndo
    funcc =  funcs{fidx}(bin,:); 

    val = funcc(:,stbl);
    for k=stbl-1:-1:1;
        val= val.*x + funcc(:,k);
    end;
    val = reshape(val, size(A));
    if doSigm
        val = bsxfun(@times, val, rsigma.^sigmpwr(fidx));
    end;
    varargout{fidx} = val;
end;